import React from 'react';

const ChangePasswordModal = ({ changePasswordModalVisible, handleCloseChangePasswordModal, newPassword, confirmPassword, passwordError, setNewPassword, setConfirmPassword, handleSaveNewPassword }) => {
  return (
    <div className={`modal ${changePasswordModalVisible ? 'show' : ''}`} style={{ display: changePasswordModalVisible ? 'block' : 'none' }} tabIndex="-1" onClick={handleCloseChangePasswordModal}>
      <div className="modal-dialog modal-dialog-centered">
        <div className="modal-content">
          <div className="modal-header bg-green">
            <h3 className="modal-title text-light fw-bold fst-italic ms-2">Cambiar Contrase単a</h3>
            <button type="button" className="btn-close" onClick={handleCloseChangePasswordModal}></button>
          </div>
          <div className="modal-body">
            <input 
              type="password" 
              className="form-control mb-3" 
              placeholder="Nueva Contrase単a" 
              value={newPassword} 
              onChange={(e) => setNewPassword(e.target.value)} 
            />
            <input 
              type="password" 
              className="form-control mb-3" 
              placeholder="Confirmar Contrase単a" 
              value={confirmPassword} 
              onChange={(e) => setConfirmPassword(e.target.value)} 
            />
            {passwordError && <div className="text-danger">{passwordError}</div>}
          </div>
          <div className="my-3 d-flex justify-content-center">
            <button className="btn btn-success bg-green" onClick={handleSaveNewPassword}>
              Guardar Contrase単a
            </button>
          </div>
        </div>
      </div>
      <div className="modal-backdrop fade show"></div>
    </div>
  );
}

export default ChangePasswordModal;
